'''兜裆布'''是指一种古代常用的内衣，是[[ACG]][[次文化]]中的'''萌属性'''。

== 简介 ==
'''兜裆布'''是古时候人类用于避免蚊虫叮咬，或处理经期产物的一种内穿衣物，现时主要用于'''相扑'''的衣物穿着上。日本兜裆布叫做'''褌'''，日本读做Fundoshi。字典解释为有裆的裤子。 一般服装设定上偏向和风/古风的角色有很大几率会穿着兜裆布。

除了上述用途，兜裆布在很长一段时间也被当成泳裤使用，在现代早期的游泳比赛中出现。<ref>[http://wasedaswim.com/team {{lj|早稲田大学水泳部}}]</ref>

